import React from 'react'
class home extends React.Component{
    check = ()=>{
        console.log("hello World");
    }
    render(){
        var val="prakash";
        return(
            <React.Fragment>
            <h1>Hello World</h1>
            <div>
                <input type="button"/>
                <h1 onClick={this.check}>hello Wolrd {val}</h1>
            </div>
            </React.Fragment>
        );       
    }
}
export default home;
